import React from "react"
import './App.css';
import GameButton from "./packages/GameButton";

const App = () => {
  const createBoard = () => {
    let board;
    for (let i = 0; i < 2; i++) {
      board += <GameButton label={"kupa"}/>
    }
    return board
  }

  return (
    <div className="App">
      {createBoard()}
    </div>
  );
}

export default App;
